import React from "react";

import HeaderImage from "../../assets/addres-page-header.png";

import "./address-page.styles.css";

const AdressPage = () => {
  return (
    <>
      <div className="reviewProduct__container">
        <div className="reviewProduct__subContainer">
          <div className="addressPage__header">
            <img alt="" src={HeaderImage}></img>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdressPage;
